That Love Each Other Always stuck me as one of my favorites. Jerry's at his best. He shredds Cumberland and that Althea is so sweet. The epitomy of Jerry, his voice sounds great and the recording is killer. What hot show and the next night is a blow out. Iam big on '81 Alpine, McArthur Court, Long Beach, Aladin and these of coarse. These being the Crown Jewel.
 The Dead at another peak. I can't imagine how fun it would have been at the Greek Theater on this Sept night. To Watch and hear these guys in this era in this venue. Jerry sounds so sweet on Candyman. The solos are so sick. I Seen em' here in '89 but this a different ball game, old-school low key family style and Jerry sounding hot as can be.

  }}}}1981 Prime Dead{{{{
